import styled from "styled-components";

const StyledList = ({ subtitle, title }) => {
  return (
    <>
      <Title>{title}</Title>
      <Subtitle>{subtitle}</Subtitle>
    </>
  );
};

export default StyledList;

const Title = styled.div`
  color: Gold;
  font-size: 22px;
  margin: 2.5%;
  text-align: center;
`;

const Subtitle = styled.div`
  color: Gold;
  font-size: 18px;
  margin: 1.5%;
  text-align: center;
`;
